import React from "react";
import "./styles/Footer.css";
import "./styles/Navigationbar.css";

const footer = props => (
  <div className="footer toolbarNavigationItems">
    <ul className="footer-ul">
      <li><button onClick={() => props.pageChanged("5")} className="button1">Impressum</button></li>
      <li>|</li>
      <li><button className="button1">Kontakt</button></li>
    </ul>
  </div>
);

export default footer;
